import copy


def get_number(A):
    index = 0
    max_ones = 0
    while index < len(A):
        if A[index] == 1:
            count = 0
            while index < len(A) and A[index] == 1:
                index = index + 1
                count = count + 1

            if count > max_ones:
                max_ones = count
        index = index + 1
    return max_ones


def recurse(A, k, index, count_map):
    if (index, k) in count_map:
        return count_map[(index, k)]

    if index == len(A):
        return get_number(A)

    if A[index] == 1:
        return recurse(A, k, index + 1, count_map)

    flipped = 0
    if k > 0:
        altered = copy.deepcopy(A)
        altered[index] = 1
        flipped = recurse(altered, k - 1, index + 1, count_map)

    original = copy.deepcopy(A)
    not_flipped = recurse(original, k, index + 1, count_map)
    ones = max(flipped, not_flipped)

    count_map[(index, k)] = ones

    return ones


def longestOnes(A, K):
    index = 0
    start = 0
    flipped = 0
    max_ones = 0
    found = False
    while index < len(A):
        num = A[index]
        if num == 0:
            if flipped < K:
                flipped = flipped + 1
            else:
                found = True
                ones = index - start
                if ones > max_ones:
                    max_ones = ones
                while A[start] != 0 and start < len(A):
                    start = start + 1
                start = start + 1
                flipped = flipped - 1
        index = index + 1

    if not found:
        return len(A)

    if A[-1] == 1:
        ones = len(A) - start
        if ones > max_ones:
            max_ones = ones



    return max_ones
